import os
import sys
import base64

b64_image = ''


def get_backgound():
    """
    :return:
    """
    filename = 'bg.jpg'
    cur_dir = os.path.dirname(os.path.realpath(sys.argv[0]))
    image_path = os.path.join(cur_dir, filename)
    if not os.path.exists(image_path):
        with open(image_path, 'wb') as f:
            f.write(base64.b64decode(b64_image))
    return image_path
